import React from "react";

const Bookmark = ({isBookmarked, bookmarkHandler, id}) => {


    return(
        <span onClick={() => bookmarkHandler(id)}>
            {isBookmarked ? 'isBookmarked' : 'NoBookmarked'}

        </span>
    )

};

export default Bookmark;
